style.css:
@-moz-document url-prefix("https://www.offensive-security.com/metasploit-unleashed/") {
body {
    background-color: #222121;
    color: #d5d5d5;
}

#meta .toc {
    background: #353535;
    color: #ddd;
}

#meta .toc .menu .active > a {
    background: transparent;
    color: #d91428;
}

#meta .toc ul li a {
    color: #f0fffc;
    padding: 0.75rem 0;
    font-size: 1rem;
    text-transform: uppercase;
}

strong {
    color: #83ee95;
}

.navigation .next a {
    color: #f2b5ff;
}

.post-navigation .next a {
    color: #f2b5ff;
}

.navigation .prev a {
    color: #f2b5ff;
}

.post-navigation .prev a {
    color: #f2b5ff;
}
}
